import React from 'react';
import createGroupIcon from '../assets/+.png'; // Import your createGroupIcon

const LeftSideContent = ({ openPopup }) => {
  return (
    <div className="container">
      <div className="group-container">
        <h1>Pocket Notes</h1>
        <button className="create-group-btn" onClick={() => openPopup()}>
          <img src={createGroupIcon} alt="Create Group" />
          Create Group
        </button>
      </div>
    </div>
  );
};

export default LeftSideContent;
